import React, { Component } from 'react'

export class FormTwo extends Component {
    constructor(props) {
        super(props)

        this.state = {

        }

    }


    render() {
        return (
            <div className="container">
                <h1>Wellcome</h1>
                <p>Please provide your information below.</p>
                <form onSubmit={this.handelSubmit}>
                    <input type="text" placeholder="First Name" name onChange={this.handelChange}/>
                    <br /> <input type="text" placeholder="Last Name"  onChange={this.handelChange}/>
                    <br />  <input type="text" placeholder="Phone number" onChange={this.handelChange} />
                    <br />  <input type="text" placeholder="Email Address" onChange={this.handelChange}/><br /> <br /><br />
                     <button type="submit">Submit</button>


                </form>
            </div>
        )
    }
}


export default FormTwo
